import React from 'react';
import {MenuList} from "../helpers/MenuList";
import "../pageStyles/Menu"

function Menu() {
  return (
    <div className='menu'>
     <h1 className='menuTitle'>Our Menu</h1>
     <div className='menuList'>{MenuList.map((menuItem,key)=>{
        return <div>{menuItem.name}</div>;
     })}
     
     </div>

    </div>
  )
}

export default Menu
